import React from 'react';


export const Home = () => {
    return (
        <div className="container">
            <div className="serviceAllItems">
                <div className="serviceItem">
                <div className="serviceTitle">Web Dev</div>
                <div className="serviceDesc">I can develop catchy UI and interactive UX based websites and web apps for you.</div>
                </div>
            </div>
        </div>
    )
}
